function buildSet(answers: string[], validWords: string[]): Set<string> {
  const s = new Set<string>();
  for (const w of answers) s.add(normalize(w));
  for (const w of validWords) s.add(normalize(w));
  return s;
}

const VALID_4: Set<string> = buildSet(ANSWERS_4, VALID_WORDS_4);
const VALID_5: Set<string> = buildSet(ANSWERS_5, VALID_WORDS_5);
const VALID_6: Set<string> = buildSet(ANSWERS_6, VALID_WORDS_6);
const VALID_7: Set<string> = buildSet(ANSWERS_7, VALID_WORDS_7);

// ══════════════════════════════════════
// Lookup by mode
// ══════════════════════════════════════

export function getAnswers(mode: number): string[] {
  switch (mode) {
    case 4: return ANSWERS_4;
    case 5: return ANSWERS_5;
    case 6: return ANSWERS_6;
    case 7: return ANSWERS_7;
    default: return ANSWERS_5;
  }
}

export function getValidWords(mode: number): Set<string> {
  switch (mode) {
    case 4: return VALID_4;
    case 5: return VALID_5;
    case 6: return VALID_6;
    case 7: return VALID_7;
    default: return VALID_5;
  }
}
